import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './Pages/Search/AuthContext';
import ProtectedRoute from './Pages/Search/ProtectedRoute';
import Login from './Pages/Login/Login';
import Search from './Pages/Search/index';
import Home from './Pages/Home/index';
import FSearch from './Pages/Search/FSearch';
import RSearch from './Pages/Search/RSearch';
import './App.css';

// Import your logo file
import logo from './assets/logo1.png'; // Adjust the path and filename as per your project structure
import MyIssues from './Pages/Home/MyIssues';

const App = () => {
  return (
    <AuthProvider>
      <BrowserRouter>
        {/* Logo element */}
        <div className="logo-container">
          <img src={logo} alt="Logo" className="app-logo" />
        </div>

        <Routes>
          <Route path="/" element={<Login />} /> {/* Render Login component */}
          <Route 
            path="/Home" 
            element={
              <ProtectedRoute>
                <Home />
              </ProtectedRoute>
            } 
          />
          <Route
            path="my-issues"
            element={
              <ProtectedRoute>
                <MyIssues />
              </ProtectedRoute>
            }
          />
          <Route 
            path="/search/*" 
            element={
              <ProtectedRoute>
                <Search />
              </ProtectedRoute>
            } 
          />
          <Route 
            path="/FSearch" 
            element={
              <ProtectedRoute>
                <FSearch />
              </ProtectedRoute>
            } 
          />
          <Route 
            path="/RSearch" 
            element={
              <ProtectedRoute>
                <RSearch />
              </ProtectedRoute>
            } 
          />
        </Routes>
      </BrowserRouter>
    </AuthProvider>
  );
};

export default App;
